/** @format */

import React from "react";
import Link from "next/link";
import { Menu } from "antd";
// eslint-disable-next-line react/prop-types
const AppLayout = ({ children }) => {
  return (
    <div>
      {children}
      <Menu mode="horizontal">
        <Menu.Item>
          <Link href="/">
            <a>홈</a>
          </Link>
        </Menu.Item>
        <Menu.Item>
          <Link href="/profile">
            <a>프로필</a>
          </Link>
        </Menu.Item>
        <Menu.Item>
          <Link href="/signup">
            <a>회원가입</a>
          </Link>
        </Menu.Item>
      </Menu>
    </div>
  );
};

export default AppLayout;
